- группа полей «Общая информация» -  очищаются поля «Дата регистрации», «Составной номер», “Уникальный номер“; “Номер“ - генерируется следующий по порядку номер; “Дата создания“ - устанавливается текущая дата на момент выполнения операции; “Статус“ - устанавливается “Проект“;
- группа полей “Заявитель“ - все поля копируются;
- группа полей “Предмет закупки“ - все поля копируются, поле “Количество“ - обнуляется;
- группа полей “Срок поставки“ - все поля очищаются;
- группа полей “Исполнитель“ - поля “Служба исполнитель“, “ФИО Куратора”, “ФИО руководителя“, “Мин доля закупки (план)“ - копируются; все остальные поля - очищаются;
- группа полей “Лот“, “Протокол“, “Ответственный за закупку“, “Договор“ - все поля очищаются.

Поле заполняется автоматически после выполнения действия «Присвоить составной номер». Предварительно заявки должны быть помечены в реестре. Перед генерацией номера выполнить проверку на идентичность значений по полям “Служба исполнитель“, “На приобретение“, “Заявитель“, “Инициатор“. В случае, если есть расхождения - номер не генерируется, необходимо выдать сообщение:

В помеченных заявках не совпадает: “Служба исполнитель“, “На приобретение“, “Заявитель“, “Инициатор“ - выводить только поля по которым есть не соответствие.

Генерируется по шаблону:

- добавляется буква "С";
- код подразделения;
- порядковый номер в реестре, в рамках подразделения и года).

Генерируется автоматически по шаблону, в момент создания заявки на закупку. Шаблон заполнения:

- добавляется буква "З";
- код подразделения;
- порядковый номер в реестре, в рамках подразделения и года.

Автоматически должны заполняться поля:

- Тип документа - “Заявка“, при создании нового документа из реестра “Реестр заявок на закупку“;
- Номер - автоматически генерируется по шаблону;
- Дата создания - автоматически, текущая дата на момент создания заявки.
- Статус - при создании нового документа - “Проект“.

